import React from "react";
import aboutPic from '../assets/images/profile.webp';
const About = () =>{
    return(
        <div className="w-full bg-white py-16 px-4">
            <div className="max-w-[1240px] mx-auto grid md:grid-cols-2">
                <img src={aboutPic} alt="aboupic" />
            </div>
            <div>
                <h1>ABOUT US</h1>
                <p>Our story began back in 2014 with 3 founders and a shared dream: to become the best at delivering world-class visualisation and immersive experiences on robust architecture.</p>
            </div>
        </div>
    )
}
export default About;
